nucleotides = "ACGT"
nucleotide_dict = {}
for i, j in enumerate(nucleotides):
     nucleotide_dict.update({j:i})

def seq2mat(seq,seq_dict):
    mat = np.zeros((len(seq_dict),len(seq)),dtype=int)
    for i,bp in enumerate(seq):
        mat[seq_dict[bp],i] = 1
    return mat

def findlmer(seq, L):
    pos = np.random.randint(0, high = len(seq)-L)
    lmer = (seq[pos:pos+L])
    #print(lmer)
    return lmer

def initialpopulation(dataset, L):
    pop = []
    for seq in dataset:
        for i in range(5):
            lmr = findlmer(seq, L)
            pop.append(lmr)
    return pop

def findmismatch(a,b):
    mismatch = 0
    for i in range(a.shape[1]):
        x = np.nonzero(a[:, i])
        y = np.nonzero(b[:, i])
        if(x != y):
            mismatch = mismatch + 1
    return mismatch

def fitness (lmer, seq): #change korte hobe, min mismatch 2 porjonto ke 0 dhorbo
    L = len(lmer)
    min_val = L
    lmer_mat = seq2mat(lmer, nucleotide_dict)
    #print(lmer_mat)
    for i in range(len(seq) - L + 1):
        #print(seq)
        sub = seq[i:i+L]
        sub_mat = seq2mat(sub, nucleotide_dict)
        c = findmismatch(lmer_mat, sub_mat)
        #print(1)
        if c < min_val:
            min_val = c
    if min_val < 2:
            min_val=0
    return min_val

def fitnessInData(lmer, data):
    fit = 0
    L = len(lmer)
    for seq in data:
        a = fitness(lmer, seq)
        #print(a)
        fit = fit + a
        #print(fit)
        #print(len(data))
    fit = fit/len(data)
    #print(fit)
    fit = ((L - fit)/L)*100
    # formated_fit = "{:.4f}".format(fit)
    return fit

def assessPopulation(pop, data, n):
    fitlist = {}
    bestlmers = []  
    bestPopulation = []
    for i in range(len(pop)):
        #print(pop[i])
        f = fitnessInData(pop[i], data)
        #print(f)
        fitlist.update({pop[i]:f})
    sort_orders = sorted(fitlist.items(), key=lambda x: x[1], reverse=True)
    #print(sort_orders)
    count = 0
    for i in sort_orders:
        if count > (n-1):
            break
        if count == 0:
            bestPopulation.append(i[0])
            bestlmers.append(i[0])
        else:
            bestPopulation.append(i[0])
        count = count+1
    #print(bestlmers)
    return bestPopulation

def consensus_mat(seq, seq_dict):
    L = len(seq)
    mat = np.zeros((len(seq_dict),len(seq[0])),dtype=float)
    #print(mat)
    c=0
    #x=0
    for j in range(len(seq)):
        for i,bp in enumerate(seq[c]):
        #print(i,bp)
        #x+=1
        #print(seq[c][i%L], end = "--")
            if seq[c][i] == 'A':
                mat[seq_dict[bp],i] += 1/L
            if seq[c][i] == 'C':
                mat[seq_dict[bp],i] += 1/L
            if seq[c][i] == 'G':
                mat[seq_dict[bp],i] += 1/L
            if seq[c][i] == 'T':
                mat[seq_dict[bp],i] += 1/L
                #print(mat)
        if c<=(len(seq)):
            c+=1
        #print(c)
        else:
            break
    return mat

def plot(z):
    fp = FontProperties(family="Arial", weight="bold") 
    globscale = 1.35
    LETTERS = { "T" : TextPath((-0.305, 0), "T", size=1, prop=fp),
                "G" : TextPath((-0.384, 0), "G", size=1, prop=fp),
                "A" : TextPath((-0.35, 0), "A", size=1, prop=fp),
                "C" : TextPath((-0.366, 0), "C", size=1, prop=fp) }
    COLOR_SCHEME = {'G': 'gold', 
                    'A': 'forestgreen', 
                    'C': 'mediumblue', 
                    'T': 'crimson'}
    def letterAt(letter, x, y, yscale=1, ax=None):
        text = LETTERS[letter]
        t = mpl.transforms.Affine2D().scale(1*globscale, yscale*globscale) + \
            mpl.transforms.Affine2D().translate(x,y) + ax.transData
        p = PathPatch(text, lw=0, fc=COLOR_SCHEME[letter],  transform=t)
        if ax != None:
            ax.add_artist(p)
        return p  
    M = []
    for i in range(len(z[0])):
        tmp = []
        t1 = ('A',z[0][i])
        tmp.append(t1)
        t2 = ('C',z[1][i])
        tmp.append(t2)
        t3 = ('G',z[2][i])
        tmp.append(t3)
        t4 = ('T',z[3][i])
        tmp.append(t4)
        M.append(tmp)
    fig, ax = plt.subplots(figsize=(10,3))
    all_scores = M
    x = 1
    maxi = 0
    for scores in all_scores:
        y = 0
        for base, score in scores:
            letterAt(base, x,y, score, ax)
            y += score
        x += 1
        maxi = max(maxi, y)
        
    plt.xticks(range(1,x))
    plt.xlim((0, x))
    plt.ylim((0, maxi))
    plt.tight_layout()
    plt.savefig("hm01r_8.png")
    plt.show()

def bestnucleotide(z):
    max = -1
    nucleotide = ""
    c = 0
    final_nucleotide = ""
    max_list=[]
    #iterating 2d matrix
    for i in range(len(z[0])):
        for j in range(len(z)):
        #checking max consensus value for each column
            if(z[j][c]>max):
                max_list=[]
                max = z[j][c]
                max_list.append(j)
            elif(z[j][c]==max):
                max_list.append(j)
        random_nucleotide = random.choice(max_list)
        if(random_nucleotide == 0):
            nucleotide = "A"
        if(random_nucleotide == 1):
            nucleotide = "C"
        if(random_nucleotide == 2):
            nucleotide = "G"
        if(random_nucleotide == 3):
            nucleotide = "T"
        final_nucleotide += nucleotide
        max = -1
        c += 1
    return final_nucleotide

