def exploitation(lmer,best,n,pop1,nu_dict):
    #count=0
    pop=[]
    while n > 0:
        if n==1:
            for j in pop1:
                w = np.random.randint(0, high = len(nu_dict))
                key = list(nu_dict.keys())[list(nu_dict.values()).index(w)]
                # while True:
                #     if key==lmer[j]:
                #         w = np.random.randint(0, high = len(nu_dict))
                #         key = list(nu_dict.keys())[list(nu_dict.values()).index(w)]
                #     else:
                #         break
                str1 = lmer[:j]
                str2 = lmer[j+1:]
                lmer = str1+key+str2
        elif n==2:
            for j in pop1:
                if lmer[j] == 'A':
                    str1 = lmer[:j]
                    str2 = lmer[j+1:]
                    lmer = str1+'T'+str2
                if lmer[j] == 'T':
                    str1 = lmer[:j]
                    str2 = lmer[j+1:]
                    lmer = str1+'A'+str2
                if lmer[j] == 'C':
                    str1 = lmer[:j]
                    str2 = lmer[j+1:]
                    lmer = str1+'G'+str2
                if lmer[j] == 'G':
                    str1 = lmer[:j]
                    str2 = lmer[j+1:]
                    lmer = str1+'C'+str2
        elif n==3:
            for j in pop1:
                if lmer[j] == 'A':
                    str1 = lmer[:j]
                    str2 = lmer[j+1:]
                    lmer = str1+'G'+str2
                if lmer[j] == 'G':
                    str1 = lmer[:j]
                    str2 = lmer[j+1:]
                    lmer = str1+'A'+str2
                if lmer[j] == 'T':
                    str1 = lmer[:j]
                    str2 = lmer[j+1:]
                    lmer = str1+'C'+str2
                if lmer[j] == 'C':
                    str1 = lmer[:j]
                    str2 = lmer[j+1:]
                    lmer = str1+'T'+str2
        if lmer not in pop:
            pop.append(lmer)
        n-=1
    return pop

def mutation(br, sh, bp):
    number = (np.random.binomial(100, 0.445, 1))/100
    pos1 = [] #non matched nucleotides position in bestpop string
    pop1 = [] #exploration ans
    pop2 = [] #exploitation result
    
    for i in bp:
        for j in range(len(i)):
            if i[j]!=sh[j]:
                pos1.append(j)
        pop2.append(pos1)
        pos1=[]
    # print("Mismatched positions: ",pop2)
    i=0
    for b in bp:
        if number<=0.48:
            pop1.extend(exploitation(b,bp,3,pop2[i],br))
            i+=1
        else:
            for i in range(3):
                for j in range(len(b)):
                    w = np.random.randint(0, high = len(br))
                    key = list(br.keys())[list(br.values()).index(w)]
                    #print("(",w,",",key,")")
                    str1 = b[:j]
                    str2 = b[j+1:]
                    b = str1+key+str2
                if b not in pop1:
                    pop1.append(b)
                # else:
                    # print("===Dupli===",b)
                    #count+=1
    #print("Duplicate nucleotides found: ", count)
    return pop1

def mutated_fit(y,ins):
    mutated_fitness={}
    for i in y:
        j = fitnessInData(i,ins)
        mutated_fitness.update({i:j})
    return mutated_fitness

def mutated_fit_sort(dict1,ins,l):
    dict_list=list(dict1.keys())
    bestmutated=assessPopulation(dict_list,ins,l)
    return bestmutated

