def motif_finding(data,l):
    #all methods
    print(l)
    ini_pop = initialpopulation(data, l)
    print(len(ini_pop))
    storage = {}
    count=0
    patience=0
    pl=[0]
    final_lmer=""
    fit=0
    
    while True:
        bestpop = assessPopulation(ini_pop, data,9)
        con_mat = consensus_mat(bestpop, nucleotide_dict)
        best_nucleotide = bestnucleotide(con_mat)
        bestnucleotide_fitness = fitnessInData(best_nucleotide,data)
        
        if(bestnucleotide_fitness > fit):
            fit=bestnucleotide_fitness
            final_lmer=best_nucleotide
            count+=1
            patience = 0
            storage.update({final_lmer:fit})
        pl.append(count)
        if pl[len(pl)-1] == count:
            patience+=1
        # print("============",patience,pl,"============")
        if patience >= 15:
            break
            #dynamic loop break while count is not increasing after n loop 

        mutated = mutation(nucleotide_dict,best_nucleotide, bestpop)
        ini_pop = bestpop+mutated

    # print(storage)
    # print(final_lmer,fit,"%")

